import React from 'react';

import Me from '..assets/images/ik.jpeg';

class Carousel extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [
                {
                    id: 0,
                    title: 'titel 1',
                    subTitle: 'subtitel 1',
                    imgSrc: Me,
                    link: 'https://l',
                    selected: false
                },
                {
                    id: 1,
                    title: 'titel 2',
                    subTitle: 'subtitel 2',
                    imgSrc: Me,
                    link: 'https://l',
                    selected: false
                },
                {
                    id: 2,
                    title: 'titel 3',
                    subTitle: 'subtitel 3',
                    imgSrc: Me,
                    link: 'https://l',
                    selected: false
                }
            ]
        }
    }

    render() {
        return(
            <p>Carousel Works!</p>
        );
    }
}

export default Carousel;
